	const items =config.items
	const deltas=config.deltas
	console.assert(items !==undefined && Object.getPrototypeOf(items )===Object.prototype)
	console.assert(deltas!==undefined && Object.getPrototypeOf(deltas)===Object.prototype)
	for(const deltaId of deltas)
	{
		for(const [name, type] of Object.entries(items))
